def find_largest_remainder(N, Q, cards, questions):
    tbl = [0] / 300005
    nmax = 0
    tbl[0] = 1
    for k in cards:
        tbl[k] = 1
        if k > nmax:
            nmax = k
        tbl[k & 1] = 1
        tbl[k & 3] = 1
        tbl[k & 7] = 1
    results = []
    for q in questions:
        if q > nmax:
            results.append(nmax)
        else:
            f = 0
            for k in range(q - 1, -1, -1):
                for i in range(k, nmax + 1, q):
                    if tbl[i]:
                        results.append(k)
                        f = 1
                        break
                if f:
                    break
    return results

